Promotional info for the collected edition - &quot;The eternal love triangle that has been the cornerstone of Archie comics for almost seven decades is finally untangled in this seven-part story written by Michael Uslan and illustrated by veteran Archie artist Stan Goldberg. The journey begins when Archie finds himself strolling up Memory Lane, and marries the wealthy and cultured Veronica Lodge. Later we see what happens when he strolls down Memory Lane and marries the wholesome, peppy girl next door, Betty Cooper.&quot;

These are archival copies of all six issues of the run and the last is labeled courtesy of HFB-CPS. The rest are presumably DCP/CPS scans as well. Thanks to the scanners for their efforts. Please seed and enjoy.

